import { useState, useEffect } from "react";
import axios from "axios";

import styled from "styled-components";

const Styles = styled.div`
    {
       background-color: yellow;
       height: 100vh; 
    }
`;

function Loading( ) {
    const [health, setQuestions] = useState([]);

    useEffect(() => {
        async function getAllQuestions() {
          const response = await axios.get(`https://private-anon-e7b3f01cb5-blissrecruitmentapi.apiary-mock.com/questions?limit=5&offset=5&filter=`);
          setQuestions(response.data);
        }
        getAllQuestions();
    }, []);

    return (
        <Styles>
            <h2>Loading</h2>

        </Styles>
    );
};

export default Loading;
